(1, 1, '2020-10-14 13:54:56', '2020-10-14 06:54:56', 'ยินดีต้อนรับสู่ WordPress นี่คือเรื่องแรกของคุณ แก้ไขหรือลบทิ้งไป แล้วมาเริ่มเขียนกัน!\r\n\r\nsss', 'สวัสดีชาวโลก - -\'', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2020-10-15 11:12:17', '2020-10-15 04:12:17', '', 0, 'http://3.0.119.171/?p=1', 5, 'post', '', 1),
(2, 1, '2020-10-14 13:54:56', '2020-10-14 06:54:56', '<!-- wp:paragraph -->\n<p>นี่คือหน้าตัวอย่าง มันแตกต่างจากเรื่องของบล็อกเพราะว่ามันจะอยู่ในที่เดียวและจะแสดงในการนำทางเว็บของคุณ (ในธีมส่วนใหญ่) หลายคนเริ่มด้วยหน้าเกี่ยวกับซึ่งแนะนำพวกเราสู่ผู้เยี่ยมชมเว็บ อาจจะพูดบางสิ่งประมาณนี้:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>สวัสดี! ฉันเป็นพนักงานส่งของในตอนกลางวัน ปรารถนาเป็นนักแสดงในตอนกลางคืน และนี่คือเว็บของฉัน ฉันอาศัยอยู่ที่ลอสแองเจลิส มีสุนัขที่ยอดเยี่ยมชื่อแจ๊ค และฉันชื่นชอบพีน่า โคลาด้า (และกำลังติดฝนอยู่)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...หรือบางสิ่งคล้ายกันนี้:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>บริษัทของเด็กเล่น XYZ ก่อตั้งในปี 1971 และได้จัดจำหน่ายของเด็กเล่นที่มีคุณภาพสู่สาธารณะตั้งแต่นั้นมา ตั้งอยู่ที่เมืองกอร์ทเทม บริษัทจ้างงานกว่า 2,000 คนและได้ทำสิ่งที่ดีเลิศมากมายสำหรับชุมชนเมืองกอร์ทเทม</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>ในฐานะผู้ใช้ WordPress ใหม่ คุณควรจะไปที่ <a href=\"http://3.0.119.171/wp-admin/\">หน้าควบคุมของคุณ</a> เพื่อลบหน้านี้ และสร้างหน้าใหม่สำหรับเนื้อหาของคุณ สนุกกัน!</p>\n<!-- /wp:paragraph -->', 'หน้าตัวอย่าง', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2020-10-14 13:54:56', '2020-10-14 06:54:56', '', 0, 'http://3.0.119.171/?page_id=2', 4, 'page', '', 0),
(3, 1, '2020-10-14 13:54:56', '2020-10-14 06:54:56', '<!-- wp:heading --><h2>เราคือใคร</h2><!-- /wp:heading --><!-- wp:paragraph --><p>ที่อยู่เว็บไซต์ของเราคือ: http://3.0.119.171</p><!-- /wp:paragraph --><!-- wp:heading --><h2>เราเก็บข้อมูลส่วนตัวอะไรบ้างและทำไมเราต้องเก็บ</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>ความเห็น</h3><!-- /wp:heading --><!-- wp:paragraph --><p>เมื่อผู้เยี่ยมชมแสดงความเห็นในเว็บไซต์ เราเก็บข้อมูลที่แสดงในฟอร์มแสดงความเห็น และหมายเลขไอพีและเบราว์เซอร์ของผู้เยี่ยมชมด้วยเพื่อช่วยการตรวจสอบสแปม</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>สตริงนิรนามถูกสร้างขึ้นจากอีเมลของคุณ (หรือที่เรียกว่าแฮช) อาจจะถูกส่งให้บริการ Gravatar เพื่อดูว่าคุณใช้งานหรือไม่ นโยบายความเป็นส่วนตัวของบริการ Gravatar สามารถดูได้ที่นี่: https://automattic.com/privacy/ หลังจากได้รับการยืนยันความเห็นของคุณ รูปภาพข้อมูลส่วนตัวของคุณจะปรากฏสู่สาธารณะในบริบทของความเห็นของคุณ</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>สื่อ</h3><!-- /wp:heading --><!-- wp:paragraph --><p>ถ้าคุณอัปโหลดรูปภาพขึ้นมายังเว็บไซต์ คุณควรจะหลีกเลี่ยงการอัปโหลดรูปภาพที่มีข้อมูลตำแหน่งที่ตั้งฝังมาด้วย (EXIF GPS) ผู้เยี่ยมชมเว็บไซต์สามารถดาวน์โหลดและดึงข้อมูลตำแหน่งที่ตั้งใด ๆ จากรูปภาพบนเว็บไซต์ได้</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>แบบฟอร์มติดต่อ</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>คุกกี้</h3><!-- /wp:heading --><!-- wp:paragraph --><p>ถ้าคุณแสดงความเห็นบนเว็บไซต์ของเรา คุณอาจจะเลือกเข้าสู่การบันทึกชื่อ อีเมลและเว็บไซต์ของคุณในคุกกี้ นี่จะเป็นการอำนวยความสะดวกสำหรับคุณโดยที่คุณไม่ต้องกรอกรายละเอียดเหล่านี้ซ้ำอีกครั้งในขณะที่คุณแสดงความเห็นอื่น คุกกี้นี้จะอยู่เป็นระยะเวลาหนึ่งปี</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>ถ้าคุณเยี่ยมชมหน้าเข้าสู่ระบบ เราจะตั้งคุกกี้ชั่วคราวเพื่อตรวจสอบว่าเบราว์เซอร์ยอมรับคุกกี้ได้ คุกกี้นี้ไม่มีข้อมูลส่วนตัวรวมอยู่ด้วยและถูกยกเลิกเมื่อคุณปิดเบราว์เซอร์ของคุณ</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>เมื่อคุณเข้าสู่ระบบ เราจะจัดตั้งหลายคุกกี้เพื่อที่จะบันทึกข้อมูลการเข้าสู่ระบบของคุณและตัวเลือกการแสดงผลหน้าจอของคุณ คุกกี้การเข้าสู่ระบบจะคงอยู่ภายในสองวัน และคุกกี้ตัวเลือกหน้าจอจะอยู่เป็นเวลาหนึ่งปี ถ้าคุณเลือก &quot;บันทึกการใช้งานของฉัน&quot; การเข้าสู่ระบบของคุณจะยังคงอยู่เป็นเวลาสองสัปดาห์ ถ้าคุณออกจากระบบบัญชีของคุณ คุกกี้การเข้าสู่ระบบจะถูกลบทิ้ง</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>ถ้าคุณแก้ไขหรือเผยแพร่บทความ คุกกี้ที่เพิ่มเติมจะถูกบันทึกไว้ในเบราว์เซอร์ของคุณ คุกกี้นี้ไม่มีข้อมูลส่วนตัวรวมอยู่และชี้ไปที่ ID ของเรื่องบทความที่คุณเพิ่งจะแก้ไข ซึ่งจะหมดอายุใน 1 วัน</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>แนบเนื้อหาจากเว็บไซต์อื่น</h3><!-- /wp:heading --><!-- wp:paragraph --><p>บทความบนเว็บไซต์นี้อาจจะมีเนื้อหาที่ถูกแนบไว้ (เช่น วีดีโอ รูปภาพ บทความ เป็นต้น) เนื้อหาที่ถูกแนบไว้จากเว็บไซต์อื่นปฏิบัติในแนวทางเดียวกันกับที่ผู้เยี่ยมชมได้เข้าชมเว็บไซต์อื่น</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>เว็บไซต์เหล่านี้อาจจะมีการเก็บข้อมูลของคุณ ใช้คุกกี้ การฝังการติดตามบุคคลที่สามเพิ่มเติม และเฝ้าดูการปฏิสัมพันธ์กับเนื้อหาที่แนบไว้ รวมถึงการติดตามการปฏิสัมพันธ์ของคุณกับเนื้อหาที่ถูกแนบไว้ถ้าคุณมีบัญชีและเข้าสู่ระบบในเว็บไซต์นั้นไว้</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>การวิเคราะห์</h3><!-- /wp:heading --><!-- wp:heading --><h2>ใครที่เราแชร์ข้อมูลของคุณด้วย</h2><!-- /wp:heading --><!-- wp:heading --><h2>เราเก็บรักษาข้อมูลของคุณไว้นานแค่ไหน</h2><!-- /wp:heading --><!-- wp:paragraph --><p>ถ้าคุณแสดงความเห็น ความเห็นและข้อมูลภายในนั้นจะถูกเก็บไว้ตลอด นี่คือสิ่งที่เราสามารถจดจำและพิสูจน์ความเห็นที่ตามมาอย่างอัตโนมัติแทนที่จะต้องชะงักไว้ในคิวการจัดการ</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>สำหรับผู้ใช้ที่ลงทะเบียนบนเว็บไซต์ของเรา (ถ้ามี) เรามีการเก็บข้อมูลส่วนตัวตามที่พวกเขาให้ไว้ในโปรไฟล์เช่นกัน ผู้ใช้ทั้งหมดสามารถดู แก้ไข หรือลบข้อมูลส่วนตัวเมื่อใดก็ได้ (ยกเว้นพวกเขาไม่สามารถเปลี่ยนชื่อผู้ใช้ได้) ผู้ดูแลเว็บไซต์สามารถเห็นและแก้ไขข้อมูลเหล่านั้นได้เช่นกัน</p><!-- /wp:paragraph --><!-- wp:heading --><h2>คุณมีสิทธิ์อะไรบ้างกับข้อมูลของคุณ</h2><!-- /wp:heading --><!-- wp:paragraph --><p>ถ้าคุณมีบัญชีบนเว็บไซต์นี้ หรือได้แสดงความเห็น คุณสามารถร้องขอไฟล์ส่งออกของข้อมูลส่วนตัวที่เราเก็บไว้เกี่ยวกับคุณได้ รวมถึงข้อมูลใด ๆ ที่คุณได้ให้ไว้กับเรา คุณสามารถร้องรอให้เราลบข้อมูลส่วนตัวต่าง ๆ ที่เราเก็บไว้เกี่ยวกับคุณได้เช่นกัน นี่ไม่รวมถึงข้อมูลใด ๆ ที่เราจำเป็นต้องเก็บสำหรับการจัดการ ข้อกฎหมาย หรือวัตถุประสงค์ด้านความปลอดภัย</p><!-- /wp:paragraph --><!-- wp:heading --><h2>เราส่งข้อมูลของคุณไปที่ใด</h2><!-- /wp:heading --><!-- wp:paragraph --><p>ความเห็นของผู้เยี่ยมชมอาจถูกตรวจสอบผ่านบริการตรวจสอบสแปมอัตโนมัติ</p><!-- /wp:paragraph --><!-- wp:heading --><h2>ข้อมูลสำหรับติดต่อของคุณ</h2><!-- /wp:heading --><!-- wp:heading --><h2>ข้อมูลเพิ่มเติม</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>เราปกป้องข้อมูลของคุณอย่างไร</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>กระบวนการช่องโหว่ข้อมูลอะไรบ้างที่เรามีในที่นี้</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>บุคคลที่สามอะไรบ้างที่เราได้รับข้อมูลมา</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>มีการตัดสินใจและ/หรือการเก็บข้อมูลอย่างอัตโนมัติอะไรบ้างที่เราทำกับข้อมูลผู้ใช้</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>ความต้องการการเปิดเผยซึ่งควบคุมบังคับในอุตสาหกรรม</h3><!-- /wp:heading -->', 'นโยบายความเป็นส่วนตัว', '', 'draft', 'closed', 'open', '', 'นโยบาย-ความเป็นส่วนตัว', '', '', '2020-10-14 13:54:56', '2020-10-14 06:54:56', '', 0, 'http://3.0.119.171/?page_id=3', 3, 'page', '', 0),
