(34, 1, '2020-10-15 16:51:06', '2020-10-15 09:51:06', '<div class=\"container\">\r\n<div class=\"row \">\r\n<div class=\"title-section col-12 text-center pb-5\">\r\n<h1><span style=\"color: #000000;\">.</span></h1>\r\n<span style=\"color: #000000;\">.</span>\r\n<h1>ซื้อขายนาฬิกากับ PSwatch ดีกว่ายังไง</h1>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"warranty-item col-12 col-md-4 text-center mb-5 mb-md-0\">\r\n<div class=\"circle-icon mb-4\"></div>\r\n<h3 class=\"mb-3\">นาฬิกาแท้คุณภาพสูง</h3>\r\nเราคัดสรรนาฬิกาของแท้คุณภาพสูง ตรงตามความต้องการของ Collector และนักสะสม จึงมั่นใจได้ว่านาฬิกาของเราได้รับการยอมรับจากคนทั่วโลก\r\n\r\n&nbsp;\r\n\r\n</div>\r\n<div class=\"warranty-item col-12 col-md-4 text-center mb-5 mb-md-0\">\r\n<div class=\"circle-icon mb-4\"></div>\r\n<h3 class=\"mb-3\">ความซื่อสัตย์มาที่หนึ่ง</h3>\r\nหมดกังวลใจว่าจะโดนหลอกลวงหรือเสียรู้ จากผู้ไม่ประสงค์ดีและมิจฉาชีพ การันตีจากลูกค้าที่พึงพอใจนับพันราย\r\n\r\n</div>\r\n<div class=\"warranty-item col-12 col-md-4 text-center mb-5 mb-md-0\">\r\n<div class=\"circle-icon mb-4\"></div>\r\n<h3 class=\"mb-3\">คุยง่ายใจดีนัดได้ทันที</h3>\r\nพ่อค้าคุยง่ายใจดี ส่งภาพรุ่นปีนาฬิกาพร้อมทั้งราคาที่ต้องการมาได้เลย\r\n\r\n<span style=\"color: #000000;\">.</span>\r\n\r\n<span style=\"color: #000000;\">.</span>\r\n\r\n<span style=\"color: #000000;\">.</span>\r\n\r\n<span style=\"color: #000000;\">.</span>\r\n\r\n</div>\r\n</div>\r\n</div>', 'section-warranty', '', 'publish', 'closed', 'closed', '', 'section-warranty', '', '', '2020-10-30 18:47:07', '2020-10-30 11:47:07', '', 0, 'http://3.0.119.171/?page_id=34', 2, 'page', '', 0),
(35, 1, '2020-10-15 16:51:06', '2020-10-15 09:51:06', '<div className=\"container\">\r\n            <div className=\"row \">\r\n              <div className=\"title-section col-12 text-center pb-5\">\r\n                <h1>ขายนาฬิกาแบรนด์ กับ PJ-WATCH ดีอย่างไร</h1>\r\n              </div>\r\n            </div>\r\n            <div className=\"row\">\r\n              <div className=\"warranty-item col-12 col-md-4 text-center mb-5 mb-md-0\">\r\n                <div className=\"circle-icon mb-4\">\r\n                  <i class=\"fa fa-balance-scale\" aria-hidden=\"true\"></i>\r\n                </div>\r\n                <h3 className=\"mb-3\">ให้ราคาดียุติธราม</h3>\r\n                <p>เรามีทีมงานมืออาชีพ ที่สามารถให้ราคาท่านได้อย่างสมเหตุสมผล ตามราคาในตลาดปัจจุบัน ไม่กดราคา</p>\r\n              </div>\r\n              <div className=\"warranty-item col-12 col-md-4 text-center mb-5 mb-md-0\">\r\n                <div className=\"circle-icon mb-4\">\r\n                  <i class=\"fa fa-shield\" aria-hidden=\"true\"></i>\r\n                </div>\r\n                <h3 className=\"mb-3\">ปลอดภัยจากมิจฉาชีพ</h3>\r\n                <p> และมีที่ตั้งหน้าร้านชัดเจน หมดกังวลจากกลุ่มมิจฉาชีพ และเราไม่เปิดเผยข้อมูลลูกค้า</p>\r\n              </div>\r\n              <div className=\"warranty-item col-12 col-md-4 text-center mb-5 mb-md-0\">\r\n                <div className=\"circle-icon mb-4\">\r\n                  <i class=\"fa fa-comments\" aria-hidden=\"true\"></i>\r\n                </div>\r\n                <h3 className=\"mb-3\">พ่อค้าคุยง่ายใจดี</h3>\r\n                <p>ท่านสามารถเสนอราคาขาย กับทางพ่อค้าได้เลย เพื่อให้ลูกค้าได้รับความพึงพอใจที่สุด</p>\r\n              </div>\r\n            </div>\r\n          </div>', 'section-warranty', '', 'inherit', 'closed', 'closed', '', '34-revision-v1', '', '', '2020-10-15 16:51:06', '2020-10-15 09:51:06', '', 34, 'http://3.0.119.171/34-revision-v1/', 0, 'revision', '', 0),
(36, 1, '2020-10-15 16:52:04', '2020-10-15 09:52:04', '<div>\r\n<div>\r\n<div>\r\n<h1>ขายนาฬิกาแบรนด์ กับ PJ-WATCH ดีอย่างไร</h1>\r\n</div>\r\n</div>\r\n<div>\r\n<div>\r\n<div></div>\r\n<h3>ให้ราคาดียุติธราม</h3>\r\nเรามีทีมงานมืออาชีพ ที่สามารถให้ราคาท่านได้อย่างสมเหตุสมผล ตามราคาในตลาดปัจจุบัน ไม่กดราคา\r\n\r\n</div>\r\n<div>\r\n<div></div>\r\n<h3>ปลอดภัยจากมิจฉาชีพ</h3>\r\nและมีที่ตั้งหน้าร้านชัดเจน หมดกังวลจากกลุ่มมิจฉาชีพ และเราไม่เปิดเผยข้อมูลลูกค้า\r\n\r\n</div>\r\n<div>\r\n<div></div>\r\n<h3>พ่อค้าคุยง่ายใจดี</h3>\r\nท่านสามารถเสนอราคาขาย กับทางพ่อค้าได้เลย เพื่อให้ลูกค้าได้รับความพึงพอใจที่สุด\r\n\r\n</div>\r\n</div>\r\n</div>', 'section-warranty', '', 'inherit', 'closed', 'closed', '', '34-revision-v1', '', '', '2020-10-15 16:52:04', '2020-10-15 09:52:04', '', 34, 'http://3.0.119.171/34-revision-v1/', 0, 'revision', '', 0),
