(38, 1, '2020-10-30 18:42:26', '2020-10-30 11:42:26', '<div class=\"container\">\n<div class=\"row align-items-center\">\n<div class=\"col-images text-md-center mb-5 mb-lg-0 col-md-12 col-lg-6\"><img src=\"http://3.0.119.171/wp-content/uploads/2020/10/peace-pswatch.png\" /></div>\n<div class=\"col-content col-md-12 col-lg-6\">\n<h1><span style=\"color: #000000;\">.</span></h1>\n<h1 class=\"mb-3 text-center text-lg-left\"><span style=\"color: #d9b138;\">รับซื้อนาฬิกา ขายนาฬิกา</span></h1>\n<p class=\"mb-3\">รับซื้อนาฬิกา ขายนาฬิกา – <span style=\"color: #d15656;\">รับซื้อนาฬิกา Rolex Patek Philippe AP Panerai Omega Tag Heuer Catier IWC ทั้งมือหนึ่งและมือสอง</span> ของแท้ทุกรุ่น พร้อมจ่ายเงินสดโอนตรงเข้าบัญชีถึงมือคุณทันที ด้วยราคาดียุติธรรม พร้อมทั้งเรายังมีนาฬิกามือสองระดับ HI-END ของแท้จำหน่ายในราคามิตรภาพแบ่งปัน</p>\n&nbsp;\n<p class=\"mb-3\">บริการด้วยความรวดเร็วตรงไปตรงมา ใส่ใจดุจญาติมิตร ดูแลพร้อมให้คำปรึกษาด้วยความจริงใจ จาก <span style=\"color: #d9b138;\">พีซ PSwatch และทีมงานพรีเมี่ยมระดับมืออาชีพ คุณจะได้รับความพึงพอใจสูงสุด</span></p>\n&nbsp;\n<p class=\"mb-3\"><span style=\"color: #4ca64c;\">การซื้อ-ขายเรายินดีนัดเจอและตรวจเช้คแท้ได้ที่ Expert Watch </span>ทุกท่านจะได้ความสบายใจสูงสุด ไม่ต้องกังวลว่าจะได้รับสินค้าคุณภาพแย่ และแม้แต่การขายก็ไม่ต้องกังวลว่าจะมีปัญหาตามมาทีหลัง</p>\n\n</div>\n</div>\n.\n\n.\n<div class=\"row align-items-center\">\n<div class=\"col-content col-md-12 col-lg-6\">\n<p class=\"mb-3\"></p>\n\n</div>\n</div>\n</div>', 'section-banner', '', 'inherit', 'closed', 'closed', '', '30-autosave-v1', '', '', '2020-10-30 18:42:26', '2020-10-30 11:42:26', '', 30, 'http://3.0.119.171/30-autosave-v1/', 0, 'revision', '', 0),
(39, 1, '2020-10-15 16:54:35', '2020-10-15 09:54:35', '<div className=\"container\">\r\n            <div className=\"row align-items-center\">\r\n              <div className=\"col-images text-md-center mb-5 mb-lg-0 col-md-12 col-lg-6\">\r\n                <img src=\"/static/images/block_1.webp\" />\r\n              </div>\r\n              <div className=\"col-content col-md-12 col-lg-6\">\r\n                <h1 className=\"mb-3 text-center text-lg-left\">ร้านรับซื้อนาฬิกา</h1>\r\n                <p className=\"mb-3\">ร้านรับซื้อนาฬิกา – รับซื้อ rolex Patek Panarai AP Omega IWC Cartier และ นาฬิกา มือสอง แบรนด์เนม ดังระดับ Hi-End ของแท้ ทุกรุ่น จ่ายเงินสด ให้ราคาดียุติธรรม</p>\r\n                <p className=\"mb-3\">เราบริการแบบมืออาชีพ มั่นใจได้เรากล้าการันตี เปิดให้บริการลูกค้ามากว่า 7 ปี และด้วยประสบการณ์มากกว่า 15 ปี ได้รับการยอมรับจากลูกค้าทั่วประเทศ</p>\r\n                <p className=\"mb-3\"> <span className=\"text-success\">เรามีบริการไปรับสินค้าด้วยตัวพ่อค้าเอง ทั้งในกรุงเทพ และต่างจังหวัด</span><br />\r\n                       ประหยัดเวลา ปลอดภัย หมดกังวลจากพวกที่แฝงตัวเป็นมิจฉาชีพ เพราะเราให้สำคัญเรื่องความไว้วางใจ มาเป็นอันดับหนึ่ง</p>\r\n              </div>\r\n            </div>\r\n          </div>', 'section-banner', '', 'inherit', 'closed', 'closed', '', '30-revision-v1', '', '', '2020-10-15 16:54:35', '2020-10-15 09:54:35', '', 30, 'http://3.0.119.171/30-revision-v1/', 0, 'revision', '', 0),
(40, 1, '2020-10-15 17:20:02', '2020-10-15 10:20:02', '<div class=\"container\">\r\n            <div class=\"row \">\r\n              <div class=\"title-section col-12 text-center pb-5\">\r\n                <h1>ขายนาฬิกาแบรนด์ กับ PJ-WATCH ดีอย่างไร</h1>\r\n              </div>\r\n            </div>\r\n            <div class=\"row\">\r\n              <div class=\"warranty-item col-12 col-md-4 text-center mb-5 mb-md-0\">\r\n                <div class=\"circle-icon mb-4\">\r\n                  <i class=\"fa fa-balance-scale\" aria-hidden=\"true\"></i>\r\n                </div>\r\n                <h3 class=\"mb-3\">ให้ราคาดียุติธราม</h3>\r\n                <p>เรามีทีมงานมืออาชีพ ที่สามารถให้ราคาท่านได้อย่างสมเหตุสมผล ตามราคาในตลาดปัจจุบัน ไม่กดราคา</p>\r\n              </div>\r\n              <div class=\"warranty-item col-12 col-md-4 text-center mb-5 mb-md-0\">\r\n                <div class=\"circle-icon mb-4\">\r\n                  <i class=\"fa fa-shield\" aria-hidden=\"true\"></i>\r\n                </div>\r\n                <h3 class=\"mb-3\">ปลอดภัยจากมิจฉาชีพ</h3>\r\n                <p> และมีที่ตั้งหน้าร้านชัดเจน หมดกังวลจากกลุ่มมิจฉาชีพ และเราไม่เปิดเผยข้อมูลลูกค้า</p>\r\n              </div>\r\n              <div class=\"warranty-item col-12 col-md-4 text-center mb-5 mb-md-0\">\r\n                <div class=\"circle-icon mb-4\">\r\n                  <i class=\"fa fa-comments\" aria-hidden=\"true\"></i>\r\n                </div>\r\n                <h3 class=\"mb-3\">พ่อค้าคุยง่ายใจดี</h3>\r\n                <p>ท่านสามารถเสนอราคาขาย กับทางพ่อค้าได้เลย เพื่อให้ลูกค้าได้รับความพึงพอใจที่สุด</p>\r\n              </div>\r\n            </div>\r\n          </div>', 'section-warranty', '', 'inherit', 'closed', 'closed', '', '34-revision-v1', '', '', '2020-10-15 17:20:02', '2020-10-15 10:20:02', '', 34, 'http://3.0.119.171/34-revision-v1/', 0, 'revision', '', 0),
