(59, 1, '2020-10-30 15:19:38', '2020-10-30 08:19:38', '<div class=\"container\">\r\n            <div class=\"row align-items-center\">\r\n              <div class=\"col-images text-md-center mb-5 mb-lg-0 col-md-12 col-lg-6\">\r\n                <img src=\"http://3.0.119.171/wp-content/uploads/2020/10/pswatch-banner.jpg\" />\r\n              </div>\r\n              <div class=\"col-content col-md-12 col-lg-6\">\r\n                <h1 class=\"mb-3 text-center text-lg-left\">ร้านรับซื้อนาฬิกา</h1>\r\n                <p class=\"mb-3\">ร้านรับซื้อนาฬิกา – รับซื้อ rolex Patek Panarai AP Omega IWC Cartier และ นาฬิกา มือสอง แบรนด์เนม ดังระดับ Hi-End ของแท้ ทุกรุ่น จ่ายเงินสด ให้ราคาดียุติธรรม</p>\r\n                <p class=\"mb-3\">เราบริการแบบมืออาชีพ มั่นใจได้เรากล้าการันตี เปิดให้บริการลูกค้ามากว่า 7 ปี และด้วยประสบการณ์มากกว่า 15 ปี ได้รับการยอมรับจากลูกค้าทั่วประเทศ</p>\r\n                <p class=\"mb-3\"> <span class=\"text-success\">เรามีบริการไปรับสินค้าด้วยตัวพ่อค้าเอง ทั้งในกรุงเทพ และต่างจังหวัด</span><br />\r\n                       ประหยัดเวลา ปลอดภัย หมดกังวลจากพวกที่แฝงตัวเป็นมิจฉาชีพ เพราะเราให้สำคัญเรื่องความไว้วางใจ มาเป็นอันดับหนึ่ง</p>\r\n              </div>\r\n            </div>\r\n          </div>', 'section-banner', '', 'inherit', 'closed', 'closed', '', '30-revision-v1', '', '', '2020-10-30 15:19:38', '2020-10-30 08:19:38', '', 30, 'http://3.0.119.171/30-revision-v1/', 0, 'revision', '', 0),
